import { Button, Container, CssBaseline, Paper, Typography } from '@mui/material';
import { Box } from '@mui/system';
import axios from 'axios';
import React, { useEffect, useState } from "react";



const App = ()=> {

    const [names, setNames] = useState([])

    const loadNames = async () => {
        const res = await axios.get('getNames')
        setNames(res.data);

    }

    useEffect(() =>{
        loadNames();
    })

  return (<>
    <CssBaseline />
    <Box bgcolor="#E3F2F0" minHeight="100vh" p={4}>
      <Container maxWidth="sm">
        <Paper>
          <Box p={4}>
            <Typography variant="h4">People to click</Typography>
            {names.map(name => {
            <Button variant="contained">
                {name.data}
            </Button>
            })}
          </Box>
        </Paper>
      </Container>
    </Box>
  </>);
}

export default App;
